  "inlineSchema": "// Supreme Price Tracker Database Schema\n// Based on memory-bank/systemPatterns.md\n\ngenerator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider  = \"postgresql\"\n  url       = env(\"DATABASE_URL\")\n  directUrl = env(\"DIRECT_URL\")\n}\n\n// Core item information\nmodel Item {\n  id          String   @id @default(cuid())\n  title       String\n  slug        String   @unique\n  brand       String   @default(\"Supreme\")\n  imageUrl    String?  @map(\"image_url\")\n  season      String?\n  styleCode   String?  @map(\"style_code\")\n  description String?\n  createdAt   DateTime @default(now()) @map(\"created_at\")\n  updatedAt   DateTime @updatedAt @map(\"updated_at\")\n\n  // Relations\n  variants Variant[]\n\n  @@map(\"items\")\n}\n\n// Item variants (size, color combinations)\nmodel Variant {\n  id     String @id @default(cuid())\n  itemId String @map(\"item_id\")\n  size   String\n  color  String\n\n  // Relations\n  item       Item         @relation(fields: [itemId], references: [id], onDelete: Cascade)\n  prices     Price[]\n  alerts     PriceAlert[]\n  watchlists Watchlist[]\n\n  @@unique([itemId, size, color])\n  @@map(\"variants\")\n}\n\n// Historical price data (append-only for full history)\nmodel Price {\n  id         String    @id @default(cuid())\n  variantId  String    @map(\"variant_id\")\n  platform   Platform\n  priceUsd   Decimal   @map(\"price_usd\") @db.Decimal(10, 2)\n  currency   String    @default(\"USD\")\n  askOrBid   PriceType @map(\"ask_or_bid\")\n  capturedAt DateTime  @default(now()) @map(\"captured_at\")\n\n  // Relations\n  variant Variant @relation(fields: [variantId], references: [id], onDelete: Cascade)\n\n  @@index([variantId, platform, capturedAt])\n  @@index([capturedAt])\n  @@map(\"prices\")\n}\n\n// User accounts and authentication\nmodel User {\n  id        String   @id @default(cuid())\n  email     String   @unique\n  name      String?\n  avatarUrl String?  @map(\"avatar_url\")\n  createdAt DateTime @default(now()) @map(\"created_at\")\n  updatedAt DateTime @updatedAt @map(\"updated_at\")\n\n  // Relations\n  watchlist Watchlist[]\n  alerts    PriceAlert[]\n\n  @@map(\"users\")\n}\n\n// User watchlists (followed items)\nmodel Watchlist {\n  id        String   @id @default(cuid())\n  userId    String   @map(\"user_id\")\n  variantId String   @map(\"variant_id\")\n  addedAt   DateTime @default(now()) @map(\"added_at\")\n\n  // Relations\n  user    User    @relation(fields: [userId], references: [id], onDelete: Cascade)\n  variant Variant @relation(fields: [variantId], references: [id], onDelete: Cascade)\n\n  @@unique([userId, variantId])\n  @@map(\"watchlist\")\n}\n\n// Price alerts for users\nmodel PriceAlert {\n  id            String         @id @default(cuid())\n  userId        String         @map(\"user_id\")\n  variantId     String         @map(\"variant_id\")\n  platform      Platform? // null = any platform\n  targetPrice   Decimal        @map(\"target_price\") @db.Decimal(10, 2)\n  condition     AlertCondition // above, below, equal\n  isActive      Boolean        @default(true) @map(\"is_active\")\n  lastTriggered DateTime?      @map(\"last_triggered\")\n  createdAt     DateTime       @default(now()) @map(\"created_at\")\n\n  // Relations\n  user    User    @relation(fields: [userId], references: [id], onDelete: Cascade)\n  variant Variant @relation(fields: [variantId], references: [id], onDelete: Cascade)\n\n  @@map(\"price_alerts\")\n}\n\n// Enums\nenum Platform {\n  STOCKX  @map(\"stockx\")\n  GOAT    @map(\"goat\")\n  GRAILED @map(\"grailed\")\n}\n\nenum PriceType {\n  ASK  @map(\"ask\")\n  BID  @map(\"bid\")\n  LAST @map(\"last\")\n}\n\nenum AlertCondition {\n  ABOVE @map(\"above\")\n  BELOW @map(\"below\")\n  EQUAL @map(\"equal\")\n}\n",
